import React from "react";

const Egg = () => {
  return (
    <div>
      <h1>testinggg</h1>
      <div>
        <input type="file" accept=".txt" onChange={e => 
            handleChangeFile(e.target.files[0])} /> 
     </div>
    </div>
  );
};
 export default Egg;
